function drawInfobox(a,i,e,t){if(e.data[t].color)var d=e.data[t].color;else d="";if(e.data[t].price)var s='<div class="price StudentName">'+e.data[t].title+"</div>";else s="";if(e.data[t].university)var r='<div class="StudentUniversity">'+e.data[t].university+"</div>";else s="";if(e.data[t].id)e.data[t].id;else"";if(e.data[t].MapIcon)e.data[t].MapIcon;else"";if(e.data[t].UsrSearchCategory)e.data[t].UsrSearchCategory;else"";if(e.data[t].url)var l=e.data[t].url;else l="";if(e.data[t].type)var c='<div class="StudentType">'+e.data[t].type+"</div>";else c="";if(e.data[t].title)e.data[t].title;else"";if(e.data[t].location)e.data[t].location;else"";if(e.data[t].gallery[0])var v=e.data[t].gallery[0];else v[0]="../img/default-item.jpg";return'<div class="infobox '+d+'"><div class="inner"><div class="image"><div class="item-specific">'+drawItemSpecific(a,e,t)+'</div><a href="'+l+'"><div class="overlay"><div class="wrapper"><a href="'+l+'" class="detail"><i class="'+e.data[t].MapIcon+'"> </i> View profile</a></div></div></a><a href="'+l+'" class="description"><div class="meta">'+s+'<p class="UserType"><i class="'+e.data[t].MapIcon+' IconMapBox"> </i> '+e.data[t].UsrSearchCategory+"</p><figure>"+r+"</figure><figure>"+c+'</figure><i class="fa fa-angle-right"></i></div></a><img src="'+v+'"></div></div></div>'}